query:
/*+ NoHashJoin(ci t mc) */ select count(*)
from cast_info AS ci
inner join title AS t
on t.id = ci.movie_id AND ci.person_id < 2604625 AND ci.role_id < 4 AND t.kind_id = 1 AND t.production_year > 2009
inner join movie_companies AS mc
on t.id = mc.movie_id AND mc.company_id < 2454 AND mc.company_type_id = 1;
